import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the mobile menu
    await page.click('.nav-menu');
    await page.waitForSelector('.mobile-menu-overlay.show');

    // Take screenshot of the mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Navigate to a category from the mobile menu
    await page.click('text=Electronics');
    await page.waitForLoadState('networkidle');

    // Take screenshot after navigating to the category
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_navigated_to_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_navigated_to_electronics.png'));

    // Verify navigation by checking if the category title is visible
    const categoryTitleVisible = await page.isVisible('text=Electronics');

    return {
      success: true,
      action: "Navigated to Electronics category from mobile menu",
      extractedData: { categoryTitleVisible },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
